import React, { useState, useEffect } from "react";
import Axios from "axios";
import Select from "react-select";
import { Header } from "./PagesElements";
import "./PagesElements.css";

const Patient = () => {
  const [pesel, setPesel] = useState("");

  return (
    <div className="App">
      <Header>Wyszukiwarka Recept</Header>
      <div>
        <label>Pesel:</label>
        <input
          type="text"
          name="pesel"
          onChange={(e) => {
            setPesel(e.target.value);
          }}
        />
      </div>
      <div>
        <label>Data od:</label>
        <input
          type="date"
          name="start_date"
          onChange={(e) => {
            setStartDate(e.target.value);
          }}
        />
      </div>
      <div>
        <label>Data do:</label>
        <input
          type="date"
          name="end_date"
          onChange={(e) => {
            setEndDate(e.target.value);
          }}
        />
      </div>
      <div>
        <label>Nazwa Leku:</label>
        <input
          type="text"
          name="product_name"
          onChange={(e) => {
            setProductName(e.target.value);
          }}
        />
      </div>
    </div>
  );
};

export default Search;
